import React, { useEffect } from "react";

const ChatPage = () => {
  const fetchData = async () => {
    const data = await axios.get("api/chat");
    console.log(data);
  };

  useEffect(() => {
    fetchData();
  }, []);
  return <div>ChatPage</div>;
};

export default ChatPage;
